import React from 'react';
import ReactDOM from 'react-dom';
import Header from './Header';
import Main from './Main';
import Footer from './Footer';

function Page() {
	return (
		/* ↓↓ this is a react fragment */
		<>
			<Header />
			<MainContent />
			<Footer />
		</>
	);
}

ReactDOM.render(<Page />, document.getElementById('root'));
